        <card>
        <section className={classes.card}>
            <h2 >Delecious Food for you and your family!</h2>
            <p className={classes.head}>choose your favoutite food from our board selection of availabe meals and enjoy delecious lunch or dinner at home</p>
            <p className={classes.head}>All our meals are cooked with high quality ingrediets, jist-i-time and of course by experimental chefs!</p>
        </section>
        </card>
    );
}

export default MealsSummary;
